import base64
import io
from PIL import Image
import os

def decode_base64_to_image_file(base64_string: str, output_path: str):
    """
    Decodifica uma string Base64 de imagem e salva a imagem em um arquivo.

    Args:
        base64_string (str): A string Base64 da imagem.
        output_path (str): O caminho completo para onde o arquivo de imagem será salvo
                           (incluindo o nome do arquivo e a extensão, ex: 'output.png').

    Raises:
        ValueError: Se a string Base64 for inválida ou o formato da imagem não for suportado.
        IOError: Se houver um problema ao salvar o arquivo.
    """
    try:
        # Decodifica a string Base64 para bytes
        image_bytes = base64.b64decode(base64_string)

        # Usa BytesIO para tratar os bytes como um arquivo em memória
        image_buffer = io.BytesIO(image_bytes)

        # Abre a imagem usando PIL (Pillow)
        img = Image.open(image_buffer)

        # Verifica e cria o diretório de saída se não existir
        output_dir = os.path.dirname(output_path)
        if output_dir and not os.path.exists(output_dir):
            os.makedirs(output_dir)
            print(f"Diretório de saída '{output_dir}' criado.")

        # Salva a imagem no caminho especificado
        img.save(output_path)
        print(f"Imagem decodificada salva com sucesso em: {output_path}")

    except base64.binascii.Error as e:
        raise ValueError(f"String Base64 inválida: {e}")
    except OSError as e:
        raise ValueError(f"Não foi possível identificar a imagem ou o formato não é suportado: {e}")
    except Exception as e:
        raise IOError(f"Ocorreu um erro ao salvar a imagem: {e}")

